var contra = window.onload = function(){

  // contra guy and audio assets
  var guy = "";
  var song = "";

  // setup keypress
  var kkeys = [],
      konami = "38,38,40,40,37,39,37,39,66,65";

  // load in font
  var font = document.createElement('link');
  font.type = 'text/css';
  font.rel = 'stylesheet';
  font.href = 'https://fonts.googleapis.com/css?family=Press+Start+2P';
  document.getElementsByTagName('head')[0].appendChild(font);

  // grab width of browser
  var browserWidth = window.innerWidth;

  // add styling and font for created elements
  var css = document.createElement('style');
  css.type = "text/css";
  css.innerHTML = "#rest30{font-family: 'Press Start 2P', cursive; font-size: 30px; font-weight: bold; color: #000; line-height: 1.5; position: fixed; top: 20px; left: 20px; z-index: 9000;} #contra{position: fixed; z-index: 9001;} .move-right{animation: moveRight 6s ease-in-out forwards;} @keyframes moveRight { from{left: -80px;} to{left: "+browserWidth+"px;} }";
  document.body.appendChild(css);

  // setup main function
  var do_contra = function(e) {
    kkeys.push( e.keyCode );
    if ( kkeys.toString().indexOf( konami ) >= 0 ) {

      console.log('Contra Easter Egg Activated!');
      console.log('Developed by Frank Laszlo <frank@franksworld.org>');

      // get random number for vertical positioning
      var pos_top = (Math.random() * (window.innerHeight - 100)).toFixed();

      window.removeEventListener('keydown', do_contra);
      kkeys = [];

      // create text block element and add to page
      var rest30 = document.createElement('div');
      rest30.id = "rest30";
      rest30.innerHTML = "1P<br />REST 30";
      document.body.appendChild(rest30);

      // create contra element and add to page
      var contraGuy = document.createElement('div');
      var image = document.createElement('img');
      var audio = document.createElement('audio');
      contraGuy.id = ('contra');
      contraGuy.style.top = pos_top + 'px';
      image.src = "data:image/gif;base64," + guy;
      audio.src = "data:audio/ogg;base64," + song;
      audio.type = "audio/ogg";
      audio.autoplay = true;
      contraGuy.appendChild(image);
      contraGuy.appendChild(audio);
      document.body.appendChild(contraGuy);

      // loop for blinking text
      var loop = setInterval(function() {
        var rst30 = document.getElementById('rest30');
        rst30.style.display = rst30.style.display === 'none' ? '' : 'none';
      }, 500);

      // character movement animation
      contraGuy.moveRight = function(){
        this.className = 'move-right';
        setTimeout(function(){
          document.body.removeChild(contraGuy);
          document.body.removeChild(rest30);
          this.className = '';
          clearInterval(loop);
          window.addEventListener('keydown', do_contra, false);
        }, 6000);
      }
      contraGuy.moveRight();
    }
  };

  // listen for keypress
  window.addEventListener('keydown', do_contra, false);
};
